import React from 'react';
import { GoogleLogin } from 'react-google-login';
import { GoogleLogout } from 'react-google-login';
import { useGoogleLogin } from 'react-google-login';

const loginGoogle = (response) => {
  console.log(response);
  console.log("logged in")
}

const logoutGoogle = (response) => {
  console.log(response);
  console.log("logged out")
}
function Home() {

  return (
    <div>
      <GoogleLogin 
        clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
        render={renderProps => (
          <button className="btn button Loginbtn" onClick={renderProps.onClick} disabled={renderProps.disabled}>Login</button>
        )}
        buttonText="Login"
        isSignedIn={true}
        onSuccess={loginGoogle}
        onFailure={loginGoogle}
        cookiePolicy={'single_host_origin'}
      />
      <GoogleLogout 
        className="Logoutbtn"
        clientId="1051194441048-4vdhlle1jsqg6jcfes3jgof8uo1sa2rn.apps.googleusercontent.com"
        render={renderProps => (
          <button className="button btn Loginbtn" onClick={renderProps.onClick} disabled={renderProps.disabled}>Logout</button>
        )}
        buttonText="Logout"
        isSignedIn={false}
        onlogoutSuccess={logoutGoogle}
      />
      {document.getElementById('googleButton')}
    </div>
  );
}

export default Home;
